          className='btns'
          buttonStyle='btn--primary'
          buttonSize='btn--large'
          onClick={console.log('hey')}
        >
          WATCH TUTORIAL <i className="far fa-play-circle"></i>
        </Button>
      </div>
    </div>
  );
}

